import React from 'react'
import {Row, Col} from 'react-bootstrap'
import HomePlace from '../Places/HomePlace'
import HomeScreenCard from './HomeScreenCard'

const HomeScreenCardItem = () => {
    return (
        <>
            <Row className="home-screen-container my-3 p-3" style={{ backgroundImage: `linear-gradient(to bottom, rgba(0, 0, 0, 0.3) 0%, rgba(0, 0, 0, 0.1) 100%),url('/image/goa.jpg')`}}>
                {
                    HomePlace.map((homeplace)=>(
                        <Col>
                            <HomeScreenCard
                                homeplace={homeplace}
                            />
                        </Col>
                    ))
                }
            </Row>
        </>
    )
}

export default HomeScreenCardItem
